import './App.css';
import Countdown from './Components/Countdown';
import background from './images/landing.jpg'
function App() {
  return (
    <div className='App'>


      <div className="logo-container">
      <div style={{ backgroundImage: `url(${background})` }}>

        { Countdown() }
      </div>
      </div>
    </div>
  );
}

export default App;
